import React from 'react';
import "./works.css";
import portfolio1 from '../../assets/protfolio1.jpg';
import portfolio2 from '../../assets/portfolio2.jpg';
import portfolio3 from '../../assets/portfolio3.jpg';
import portfolio4 from '../../assets/portfolio4.jpg';
import portfolio5 from '../../assets/portfolio5.jpg';
import portfolio6 from '../../assets/portfolio6.jpg';

function Works() {
    const email = "bhardwajpriyanshu300@gmail.com";

    const handleHireMeClick = () => {
        window.location.href = `mailto:${email}`;
    };

    return (
        <section className="works">
            <h2 className="workstitle">My Portfolio</h2>
            <span className="worksdesc">I take pride in paying attention to the smallest details and make sure that my work is pixel perfect. I am excited to bring my skills and experience to help businesses achieve their goals ad create a strong online prescence."</span>
            <div className="worksImgs">
                <img src={portfolio1} alt="" className="worksImg" />
                <img src={portfolio2} alt="" className="worksImg" />
                <img src={portfolio3} alt="" className="worksImg" />
                <img src={portfolio4} alt="" className="worksImg" />
                <img src={portfolio5} alt="" className="worksImg" />
                <img src={portfolio6} alt="" className="worksImg" />
            </div>
            <button className="workBtn" onClick={handleHireMeClick}>Hire Me</button>
        </section>
    );
}

export default Works;
